long_desc.thetext:
Found a bug where in TablePaneScroller.js the first row was calculated by following formula:

  var firstRow = Math.floor(scrollY / rowHeight);

which leads to negative firstRow numbers if the vertical scrollbar is invisible.
So an additional test should be made if firstRow gets negative:

 if (firstRow < 0) {
   firstRow = 0;
 }

A patch is attached.
